/*update data with specific trip_type, language, location and image*/

CREATE TABLE myTable (
  Username varchar(255) default NULL,
  Date varchar(255),
  Date_of_Stay varchar(255),
  Trip_Type TEXT default NULL,
  Room_Tip TEXT default NULL,
  Trip_Rating mediumint default NULL,
  Service_Rating mediumint default NULL,
  Sleep_Rating mediumint default NULL,
  Location_Rating mediumint default NULL,
  Value_Rating mediumint default NULL,
  Header TEXT default NULL,
  Body TEXT default NULL,
  User_Contributions mediumint default NULL,
  Helpful_Votes mediumint default NULL
);

